":{\"inputFieldSize\":\"10\",\"requiredField\":false,\"taskDescription\":\"<p>With all that you have learned about Poikilotherms and Homeotherms, compare a mouse and a lizard. Use small sentences with the contrast terms \\\"<strong>while\\\".</strong></p>\\n\\n<p>To help you, click at the \\\"<strong>hints</strong>\\\" on the upper right of the page.</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"229fa775-158f-4467-8109-f0895a45d83d\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}}],\"helpTextLabel\":\"Hints\",\"helpText\":\"<p>increases/decreases oxygen consumption</p>\\n\\n<p>increases/decreases food consumption</p>\\n\\n<p>increases/decreases activity</p>\\n\\n<p>influence of external temperature on internal temperature</p>\\n\\n<p>cold-blooded/warm-blooded</p>\\n\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"a04e9fb3-2f5b-469b-86c2-9ef7dc67636d\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Of mouse and lizard\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Of mouse and lizard\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>The lizard decreases its activity at low temperature, <strong>while </strong>the mouse is not affected by low temperature.</p>\\n\\n<p>The lizard decreases its food and oxygen consumption at low temperature, <strong>while</strong> the mouse increases it to produce more energy.</p>\\n\\n<p>The lizard cannot reach its optimal energy when it is cold. It is affected by the external temperature. It is a poikilotherm w<strong>hile </strong>the mouse increases its activity when it is cold, to keem warm.</p>\\n\\n<p>The external temperature affects the internal temperature of a lizard<strong> while it </strong>does not affect the internal temperature of a mouse.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"8b0abd01-cc9d-4b21-94c7-d9117811adc3\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"ff82c7a3-5b28-4fc0-920f-d5f16c6525c0\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Do not read before trying to answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Do not read before trying to answer\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"d0ed2e4e-f350-44b5-9d0a-6ec6be04a148\",\"metadata\":{\"title\":\"Of mouse and lizard\",\"license\":\"U\",\"contentType\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Of mouse and lizard\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Frozen iguanas\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABsoAAAPICAYAAABw8K59AAAKG2lDQ1BJQ0MgUHJvZmlsZQAASImVlgdQVNcax8+92xttl5XO0ntvCwgsLL1Ir6Ky7MJSF1iK2BEJRiCiiIiAIkioCkZDjQWxYCEIKGLPIkFAeQYLoqLyLpKX5L15mTfvm/nm/O5/zvnOd+85M/cPACmOk5qaBEsAkCzIEAa4OTHCwiMYuHGAAXhAAUyA53DTUx39/LzB38a7uwBaHm8bLNf6+3n/NSR5MelcACA/hFN46dxkhHsRduamCjMAgNEIq23MSF1mbYRpQqRBhFcvM3+Fl9fSoleY93VOUAAb4WwA8GQOR8gHgJiH6IwsLh+pQ6xD2FjAixcgfAdhe24cB1lHoiGsn5ycsswshLWj/1KH/281o/+oyeHw/+CVd/ka0uyUpBQhw5vtzGBzkuKjhZyMGN7/+W3+ZyQnZf5rv+UTIMcIggOX+0ZSAbBBCkhCUggYwBt5ckZGNuAgWjyIRlQOyAAxgJcRk52xXICdkrpJGM+Py2A4IqcYw/AQcA31GabGJlYALN+JlW3e0L/uBNFv/KmlIedlXYCI/D81jhoA3c8AoL77U1N7jbS4D4BzQ9xMYdaKtny8yF0jAnFAA7JACagh3RsAU2AJbAELuABP4AuCQDhYD7ggDiQjfW8EW8FOkA8KwT5wEFSAanAcNIKT4DToBGfBRXAV3ARDYBQ8BCIwCV6AOfAOLEIQhIMoEBWShZQhDUgPMoWYkD3kAnlDAVA4FAXxIQGUCW2FdkGFUAlUAdVATdAPUDd0EboODUP3oXFoBnoNfYRRMBmmwYqwJmwEM2FH2AsOgtfBfDgN3gznwXvhcrgWPgF3wBfhm/AoLIJfwPMogCKh6CgVlAGKiWKjf "inputFieldSize\":\"10\",\"requiredField\":false,\"taskDescription\":\"<p>Can you explain that? You can click on <strong>\\\"hints</strong>\\\" to get some help.</p>\\n\",\"remainingChars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"81c485d3-7dc8-4f53-bf39-f6ff0df38a97\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}}],\"helpTextLabel\":\"Hints\",\"helpText\":\"<p>Iguanas are reptiles.</p>\\n\\n<p>They are cold-blooded animals.</p>\\n\\n<p>They go into slow life when it is cold.</p>\\n\\n<p>The external temperature has a direct effect on their internal temperature.</p>\\n\\n<p>They need to warm up in the sun to adjust their internal temperature.</p>\\n\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"33236306-84aa-46e6-ada5-617b259ef7da\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Frozen iguanas\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Frozen iguanas\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Green iguanas, like all reptiles, are cold-blooded animals, so when the temperature falls to a certain level, they become motionless and enter a slow life. When they get warm again, they return to active life.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"3b094384-8708-4923-bb2e-000f3d56a104\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"b7b744aa-aee3-4157-b63d-4717f5bdd938\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Do not read before trying to answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Do not read before trying to answer\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"librar
